import React from 'react'
import classes from './Conditions.module.css'

const Conditions = (props) => {
    return (
        <div>
            {props.responseObj.cod === 200 ?
                <div>
                    <p>{props.responseObj.name}</p>
                    <p>Temperature: {Math.round(props.responseObj.main.temp)} 
                    {Math.round(props.responseObj.main.tempmin)}
                    {props.responseObj.main.tempmax}
                    Feels like: {props.responseObj.weather[0].description}.</p>
                </div>
            : null
            }
        </div>
    )
}

export default Conditions
